    true,nt"url": null,nt"notes": "The Healthy, Hunger-Free Kids Act (HHFKA)
    directed USDA to study the extent to which school food authorities (SFAs) participating
    in the National School Lunch Program (NSLP) and School Breakfast Program (SBP) pay
    indirect costs to local education agencies (LEAs). It specifically requested an
    assessment of the methodologies used to establish indirect costs, the types and
    amounts of indirect costs that are charged and not charged to the school food service
    account, and the types and amounts of indirect costs recovered by LEAs. To address
    the research questions, information was collected from four perspectives: (1) the
    State education agency finance officer, (2) the State child nutrition director,
    (3) the LEA business manager, and (4) the SFA director.",nt"license_title":
